import React from 'react'

class TodoItem extends React.Component {

    render() {

        return (
            <div className="todo-item">
                <input className="checkbox" type="checkbox"></input>
                <h3>{this.props.todo.text}</h3>
            </div>
        )
    }
}

export default TodoItem
